"use strict";var timeline=[{title:"Departemen Pariwisata, Pos, dan Telekomunikasi (Depparpostel)",title_en:"Department of Tourism, Post and Telecommunication",tahun:"<i>(1983-1998)</i>",desc_en:"\n        <p>\n            The history of the Ministry of Tourism dates back to 1963. In the Fifth Development Cabinet, President Soeharto established the Department of Tourism, Post and Telecommunication and appointed Achmad Tahir as its minister.\n        </p>\n        <p>\n            Among the government’s first strategies to attract foreign tourists was to impose visa-free policy for 26 countries. Adding to that, the government also named 9 airports and 7 seaports as gates for international visitors. Since then, tourism industry began to bloom.\n        </p>\n        <p>\n            In 1988, Achmad left his post and was succeeded by Soesilo Soedarman. Soesilo, who served as a minister until 1993, did some breakthroughs in the ministry. He initiated the Sapta Pesona program which is still widely recognized up to this day. He also launched the Visit Indonesia Year 1911 program.\n        </p>\n        <p>\n            In 1990, Indonesia passed the Law No. 9/1990 on Tourism and tourism in the country was started to be developed based on firm legal foundation.\n        </p>\n        <p>\n            In the following year, the government for the first time ever launched Visit Indonesia Year or VIY program. This was the New Order’s strategy to promote Indonesia’s tourism to the world.\n        </p>\n        <p>\n            In 1992, simultaneously with the Visit Indonesia Year 1992, the government also introduced Visit Indonesia Decade. Throughout the decade, Visit Indonesia Year was held with different theme each year, namely:\n        </p>\n        <ul>\n            <li>1993 – the Year of Environment</li>\n            <li>1994 – the Year of Women’s Roles in Development, Youth and Sports</li>\n            <li>1995 – Indonesia’s 50th Independence Day</li>\n            <li>1996 – the Year of Maritime and Aerospace</li>\n            <li>1997 – the Year of Telecommunication</li>\n            <li>1998 – the Year of Arts and Culture</li>\n            <li>1999 – the Year of Crafts</li>\n            <li>2000 – the Year of Technology Utilization to Improve Quality of Life</li>\n        </ul>\n        <p>Throughout the decade, Indonesia was trusted to hold a number of international events. Indonesia also joined several cultural promotion programs in many countries.</p>\n        ",desc:'\n                    \n                    <p>\n                    Sejarah Kementerian Pariwisata sendiri dimulai pada 1983. Dalam kabinet Pembangunan IV, Presiden Soeharto membentuk Departemen Pariwisata, Pos dan Telekomunikasi (Depparpostel) dengan Menteri Achmad Tahir.\n                    </p>\n                    \n                    <p>\n                        Pada masa itu, untuk memudahkan wisatawan berkunjung ke Indonesia, pemerintah menetapkan bebas visa untuk 26 negara dan 9 bandara dan 7 pelabuhan laut sebagai pintu masuk wisatawan. Pengusaha jasa pariwisata dan perajin pun mulai bergeliat.\n                    </p>\n               \n                    \n                    <p>\n                        Tahun 1988, tongkat estafet jabatan Menparpostel pindah tangan ke Soesilo Soedarman. Seosilo menjabat hingga 1993. Di bawah kepemimpinannya, banyak terobosan yang ia buat. Di antaranya program Sapta Pesona yang masih bergaung hingga sekarang dan kampanye\n                        Visit Indonesia Year 1991.\n                    </p>\n\n                    <div class="special-image mr-3">\n                        <img src="assets/img/timeline-modal1.png">\n                        <div class="text-center"><small>KOMPAS/HASANUDDIN ASSEGAFF (HS)</small></div>\n                    </div>\n                    \n                    <p>\n                        Pada 1990, pemerintah mengesahkan Undang-undang tentang Kepariwisataan No. 9 Tahun 1990. Pembangunan industri pariwisata Indonesia mulai dilakukan dengan berdasarkan landasan hukum yang kuat.\n                    </p>\n                    \n                    <p>\n                        Di tahun berikutnya atau 1991, Visit Indonesia Year atau VIY dicanangkan untuk pertama kali. Ini merupakan upaya pemerintahan Orde Baru mempromosikan Indonesia di kancah industri pariwisata dunia.\n                    </p>\n                    \n                    <p>\n                        Tahun 1992, berbarengan dengan Visit Indonesia Year 1992, pemerintah meluncurkan pula Visit Indonesia Decade atau Dekade Kunjungan Indonesia. Di era 90-an ini, Visit Indonesia Year dihelat setiap tahun dengan mengusung tema beragam, di antaranya:\n                    </p>\n                    <ul>\n                        <li>1993 - Tahun Lingkungan Hidup</li>\n                        <li>1994 - Tahun Peran Wanita dalam Pembangunan, Pemuda dan Olahraga</li>\n                        <li>1995 - 50 Tahun Peringatan Kemerdekaan Republik Indonesia</li>\n                        <li>1996 - Tahun Bahari dan Dirgantara</li>\n                        <li>1997 - Tahun Telekomunikasi</li>\n                        <li>1998 - Tahun Seni dan Budaya</li>\n                        <li>1999 - Tahun Kriya dan Rekayasa</li>\n                        <li>2000 - Tahun Pemanfaatan Teknologi untuk Peningkatan Kualitas Hidup</li>\n                    </ul>\n                    <p>\n                        Sepanjang dekade tersebut, Indonesia makin banyak mendapat kepercayaan untuk menyelenggarakan acara internasional dan terlibat dalam promosi budaya ke berbagai negara di dunia.\n                    </p>'},{title:"Departemen Pariwisata, Seni dan Budaya (Depparsenibud)",title_en:"Department of Tourism, Arts and Culture",tahun:"(1998-1999)",desc_en:"<p>During this period, Department of Tourism, Arts and Culture was led by Minister Marzuki Usman in President’s B. J. Habibie’s Development Reform Cabinet.</p>",desc:"Pada masa ini, jabatan Menteri Pariwisata, Seni dan Budaya dipegang oleh Marzuki Usman dalam Kabinet Reformasi Pembangunan yang dibentuk oleh Presiden B.J. Habibie."},{title:"Kementerian Negara Pariwisata dan Kesenian (Kemengparsen)",title_en:"State Ministry of Tourism and Arts (1999-2001)",tahun:"(1999-2001)",desc_en:"\n            <p>\n                When the institution was named the State Ministry of Tourism and Arts, it was led by two ministers in two different periods: Hidayat (1999-2000) and I Gede Ardhika (2000-2001). Both were sworn in by President Abdurrahman Wahid. In 2000, when the president was replaced by Megawati Soekarnoputri, I Gede Ardhika managed to maintain his position.\n            </p>\n            <p>\n                In 2001, the institution’s name changed to the State Ministry of Culture and Tourism\n            </p>\n        ",desc:"<p>Saat lembaga ini bernama Kementerian Negara Pariwisata dan Kesenian, ada dua orang yang menduduki kursi menteri. Yakni Hidayat Jaelani sejak 1999 hingga 2000 dan I Gede Ardhika sejak 2000 hingga 2001. Keduanya dilantik oleh Presiden Abdurrahman Wahid. Pada 2000 saat jabatan presiden digantikan oleh Megawati Soekarnoputri, I Gede Ardhika bertahan pada posisinya.</p><p>Di tahun 2001, nama kementerian diganti menjadi Kementerian Negara Kebudayaan dan Pariwisata.</p>"},{title:"Kementerian Negara Kebudayaan dan Pariwisata (Kemenegbudpar)",title_en:"State Ministry of Culture and Tourism (2001-2005)",tahun:"(2001-2005)",desc_en:"\n        <p>\n            Indonesia’s tourism was faced with turbulence shortly after the 2002 Bali Bombings occurred. The number of tourists in Bali plummeted by 32 percent. In the following years, a series of terrorist attack (the 2003 JW Marriot, the 2004 Australian Embassy and the 2005 Bali bombings) happened and caused even more severe impact to the nation’s tourism. These had prompted many countries issued travel ban into Indonesia for their citizens.\n        </p>\n        ",desc:"<p>Dinamika pariwisata Indonesia berada dalam masa paling berat pasca Bom Bali tahun 2002. Peristiwa tersebut menyebabkan penurunan jumlah kunjungan wisatawan asing ke Bali hingga 32%. Sejumlah insiden pemboman lain (JW Marriot 2003, Kedutaan Besar Australia 2004, Bom Bali 2005, dll) juga menimbulkan dampak serupa. Aksi-aksi terorisme tersebut mengakibatkan sejumlah negara mengeluarkan larangan perjalanan ke Indonesia bagi warga negara masing-masing.</p>"},{title:"Departemen Kebudayaan dan Pariwisata (Depbudpar)",title_en:"Department of Culture and Tourism",tahun:"((2005-2009))",desc_en:'\n            <p>\n                During this period, Minister of Culture and Tourism Jero Wacik had a huge responsibility. Indonesian tourism, under his leadership, must be able to rise from crises caused by the series of terrorism acts.\n            </p>\n            <div class="special-image mr-3">\n                <img src="assets/img/timeline-modal2.png">\n                <div><small>Lorem ipsum</small></div>\n            </div>\n            <p>\n                The year 2008 was recorded as a turning point for the nation’s tourism after the government relaunched the Visit Indonesia Year program. That year, Indonesia commemorated its 100th National Resurgence Day. Under President Soesilo Bambang Yudhoyono and Minister Jero Wacik, the Department of Culture and Tourism organized Visit Indonesia Year 2008 with Unity in Diversity as its themed and using Rp 200 billion of state budget.\n            </p>\n            <p>\n                In December that year, Jero Wacik claimed that the Visit Indonesia Year 2008 program had been successful. Indonesia managed to achieve its targets on the number of foreign tourists and the amount of foreign exchange.\n            </p>\n            ',desc:'\n            <p>Kala itu, tanggung jawab besar dirasakan oleh Menteri Budaya dan Pariwisata Jero Wacik. Pariwisata Indonesia, di bawah komandonya, harus mampu bangkit dari keterpurukan pasca serentetan aksi terorisme yang terjadi di Tanah Air.</p>\n            <div class="special-image mr-3" style="float:right">\n                <img src="assets/img/timeline-modal2.png">\n                <div class="text-right"><small class="text-right">KOMPAS/YUNIADHI AGUNG (MYE)</small></div>\n            </div>\n            <p>Tahun 2008 merupakan titik balik kampanye pariwisata Indonesia dengan kembali digulirkannya Visit Indonesia Year 2008. Pada tahun tersebut, Indonesia memperingati Hari Kebangkitan Nasional yang ke-100. Di bawah kepemimpinan Presiden Soesilo Bambang Yudhoyono dan Menteri Jero Wacik, Departemen Kebudayaan dan Pariwisata mengambil tema Unity in Diversity untuk VIY 2008 dengan anggaran Rp 200 miliar.</p>\n            <p>Bulan Desember tahun itu, Jero Wacik mengatakan bahwa program Visit Indonesia Year 2008 berjalan sukses. Tak hanya target jumlah turis mancanegara yang tercapai, devisa yang diterima negara juga berhasil melampaui target.</p>\n        '},{title:"Kementerian Kebudayaan dan Pariwisata (Kemenbudpar)",title_en:"Ministry of Culture and Tourism",tahun:"(2009-2011)",desc_en:"\n            <p>\n                When SBY began his second term as a president in 2009, Jero Wacik also maintained his position as a minister. Between Jero’s first and second term as Minister of Culture and Tourism, the position was filled in by Mohammad Nuh as an ad-interim minister for 20 days.\n            </p>\n        ",desc:"<p>Saat Presiden SBY dilantik untuk kedua kalinya sebagai presiden tahun 2009, Menteri Jero Wacik juga kembali ke posisinya sebagai Menteri Budaya dan Pariwisata, meski sempat digantikan oleh Mohammad Nuh selama 20 hari.</p>"},{title:"Kementerian Pariwisata dan Ekonomi Kreatif (Kemenparekraf)",title_en:"Ministry of Tourism and Creative Economy",tahun:"(2011-2014)",desc_en:"\n            <p>\n                In 2011, the Ministry of Tourism and Creative Economy launched the Wonderful Indonesia campaign. Through this program, Indonesia welcomed 6.75 million foreign tourists in 2011.\n            </p>\n            The number kept growing in the following years when Mari Elka Pangestu served as the minister. She was the first woman minister in the Ministry of Tourism and Creative Economy. The number of foreign tourists travelling to Indonesia grew from 8.04 million people in 2012, 8.8 million in 2013 and 9.44 million in 2014.\n        ",desc:"\n            \n            <p>Tahun 2011, Kementerian Kebudayaan dan Pariwisata meluncurkan kampanye Wonderful Indonesia. Melalui kampanye ini, sepanjang 2011 menerima kedatangan 6,75 juta wisatawan mancanegara.</p>\n\n            <p>Angka tersebut terus tumbuh di tahun-tahun berikutnya saat posisi Menteri Pariwisata dan Ekonomi Kreatif dijabat oleh Mari Elka Pangestu, menteri perempuan pertama dalam kementerian ini. Jumlah wisatawan mancanegara meningkat jadi 8,04 juta orang di tahun 2012, 8,8 juta di tahun 2013 dan 9,44 juta di tahun 2014.</p>\n            <p>Wonderful Indonesia masih berjalan hingga hari ini. Melalui situs www.indonesia.travel, Kementerian Pariwisata dan Ekonomi Kreatif menyajikan beragam informasi tentang pariwisata di Nusantara. Mulai dari pilihan destinasi dan atraksi wisata menarik, hingga informasi dasar mengenai Indonesia seperti mata uang, iklim, pusat informasi penting, dan lainnya.</p>\n        "},{title:"Kementerian Pariwisata (Kemenpar)",title_en:"Ministry of Tourism",tahun:"(2014-2019)",desc_en:"\n        <p>\n            In 2015, when President Joko Widodo was in his first term and he appointed Arief Yahya as Minister of Tourism, the government splurged Rp 1.3 trillion to boost it tourism industry.\n        </p>\n        <p>\n            While serving as a minister, Arief received a lot of compliments and awards for being able to develop Indonesia’s tourism to many new levels. He introduced 10 Bali Baru or 10 New Balis to promote tourist destination sites other than Bali in Indonesia.\n        </p>\n        <p>\n            The nation’s tourism also earned some breakthroughs within this era. Indonesia climbed up the ranking ladder in the World Economic Forum’s (WEF) Travel and Tourism Competitiveness Index (TTCI). It secured the 40th position out of 140 countries in 2019, from 70 in 2013.\n        </p>\n        ",desc:"<p>Tahun 2015, saat kursi presiden diduduki oleh Presiden Joko Widodo dan Arief Yahya sebagai Menteri Pariwisata, pemerintah memberikan penambahan dana promosi Rp 1,3 triliun untuk sektor pariwisata.</p>\n\n        <p>\n            Kiprah Arief Yahya sebagai Menteri Pariwisata banyak mendapat pujian dan penghargaan, sebab selama periode tersebut pariwisata di Indonesia mengalami sejumlah kemajuan. Ia memperkenalkan 10 Bali Baru untuk mempromosikan daerah tujuan wisata lain di Indonesia kepada turis domestik dan mancanegara.\n        </p>\n        \n        <p>\n            Sejumlah capaian diraih sektor kepariwisataan Indonesia pada masa ini. Salah satunya adalah peringkat daya saing pariwisata Indonesia yang kian meningkat. Pada Travel and Tourism Competitiveness Index (TTCI) yang dikeluarkan oleh World Economic Forum (WEF), Indonesia berada pada peringkat 40 dari 140 negara di tahun 2019, melesat dari peringkat 70 di tahun 2013.\n        </p>\n        "},{title:"Kementerian Pariwisata dan Ekonomi Kreatif (Kemenparekraf)",title_en:"Ministry of Tourism and Creative Economy",tahun:"(2019-sekarang)",desc_en:'\n        <p>\n            The nation’s tourism also earned some breakthroughs within this era. Indonesia climbed up the ranking ladder in the World Economic Forum’s (WEF) Travel and Tourism Competitiveness Index (TTCI). It secured the 40th position out of 140 countries in 2019, from 70 in 2013.\n        </p>\n        <div class="special-image mr-3">\n            <img src="assets/img/timeline-modal4.png">\n            <div><small>Lorem ipsum</small></div>\n        </div>\n        <p>\n            Now, under Wishnutama, the nation’s tourism is being developed by focusing on quality-oriented development, instead of aiming quantitative targets only. While previously, the government only chased after the increase in number of foreign tourists, now the ministry pours more attention to improving service to give the best experience to tourists. This strategy is believed to be able to attract more tourists and more foreign exchange.\n        </p>\n        <p>\n            In 2020, the tourism industry was heavily affected by the unprecedented crisis: the COVID-19 pandemic. Suddenly, any tourism development must be stopped. Many people who rely on the tourism industry for a living had to lose their jobs because less and less people are travelling during the pandemic.\n        </p>\n        <p>\n            As an attempt to weather the crisis, the ministry launched the Cleanliness, Health, Safety and Environmental Sustainability (CHSE) program. The program is an effort to transform the tourism and creative economy industries to adapt with certain health standards as the world is entering the new normal era. The CHSE is also expected to support a more sustainable tourism development in the country.\n        </p>\n        <p>\n            Also in 2020, the ministry introduces the #BeliKreatifLokal of #BuyLocalCreative[Crafts]. The movement is aimed at supporting people in the creative economy industry in running their business – particularly in fashion, culinary and handicraft – after being impacted by the COVID-19 crisis.\n        </p>\n        <p>\n            In carrying out this program, the ministry partners up with Blibli, Gojek, Grab, Blue Bird, Bukalapak, Tokopedia, Shopee and Kontrak Hukum. The program provides support in the form of co-branding, distribution channel through online platforms and integrated marketplace, legal assistance to establish legal entity for business and take care of the intellectual property rights (HKI) certification.\n        </p>\n\n        ',desc:'<p>Di periode kedua Presiden Jokowi, ia menunjuk tokoh yang namanya besar di dunia penyiaran sebagai pengganti Arief Yahya, yakni Wishnutama Kusubandio. Nama lembaganya pun diubah kembali menjadi Kementerian Pariwisata dan Ekonomi Kreatif.</p>\n\n        <div class="special-image mr-3" style="float:right">\n            <img src="assets/img/whisnutama.png">\n            <div class="text-right"><small>SUMBER: BIRO KOMUNIKASI</small></div>\n        </div>\n        <p>\n        Kini, di bawah kepemimpinan Wishnutama, pengembangan pariwisata Tanah Air difokuskan untuk lebih berorientasi pada kualitas, alih-alih masih memberatkan segi kuantitas. Dari yang semula mengejar angka jumlah kunjungan, sekarang kementerian ini mencurahkan lebih banyak tenaga untuk memberikan pengalaman berkesan bagi wisatawan. Strategi ini diyakini lebihefektif untuk menarik lebih banyak devisa.\n        </p>\n        \n        <p>\n        Tahun 2020, Kemparekraf di bawah Wishnutama menghadapi tantangan yang belum pernah dialami menteri-menteri sebelumnya: pandemi COVID-19. Seketika industri pariwisata harus menunda segala rencana pengembangan. Bahkan tak sedikit pelaku bisnis di sektor ini yang harus kehilangan pekerjaan karena tak ada orang yang berwisata demi mencegah penularan virus mematikan ini.</p>\n\n        <p>Tak menghabiskan waktu terlalu lama berdiam diri, Kemenparekraf mencanangkan program Cleanliness, Health, Safety and Environmental Sustainability (CHSE). Program ini digagas sebagai bentuk adaptasi di bidang pariwisata dan ekonomi kreatif terkait penerapan protokol kesehatan selama pandemi masih melanda -- atau disebut pula era kenormalan baru. CHSE juga menjadi faktor penting dari pengembangan pariwisata agar lebih berkelanjutan.</p>\n        \n        <p>Tahun 2020, Kemenparekraf juga mencanangkan gerakan #BeliKreatifLokal. Gerakan ini bertujuan untuk membantu para pelaku ekonomi kreatif, khususnya subsektor fesyen, kuliner dan kriya agar kembali bangkit dari krisis akibat pandemi COVID-19.</p>\n        \n        <p>Pihak Kemenparekraf menjalankan gerakan ini dengan bekerja sama dengan Blibli, Gojek, Grab, Blue Bird, Bukalapak, Tokopedia, Shopee dan Kontrak Hukum. Dukungan yang diberikan pada para pelaku ekonomi kreatif di antaranya co-branding, penyaluran produk melalui platform transportasi daring dan marketplace terintegrasi, pendampingan konsultasi hukum untuk pendirian badan hukum dan pengurusan sertifikasi Hak Kekayaan Intelektual (HKI).\n        </p>\n        '}];
//# sourceMappingURL=data:application/json;charset=utf-8;base64,